import logo from './logo.svg';
import './App.css';

function App() {
  return (
   <Router>
    <div className='container'>
      <nav>
        <ul>
          <li>
            <Link to="/">List</Link>
          </li>
        </ul>

      </nav>
    </div>

   </Router>
  );
}

export default App;
